import "../cssCredit/creditName.css";

const CreditOptions = () => {
    return(
        <div>
            <h1 className="creditName">Кредиты</h1>
            <div className="anyPur">
                <h1></h1>
            </div>
            <div className="refinan"></div>
            <div className="education"></div>
            <div className="mentlan"></div>
        </div>
    )
}
export default CreditOptions;
